/**
 * 
 * @param {type} obj
 * @returns {unresolved}
 * @author Vishnu K
 */
function serializeObject(obj)
{
    var o = {};
    var a = $(obj).serializeArray();

    $.each(a, function () {
        if (this.value) {
            o[this.name] = this.value;
        }
    });
    return o;
}

