/**
 * 
 * @param {type} trnd46
 * @param {type} trnd03
 * @returns {String}
 * @author Vishnu K
 */
function trendCalculator(trnd46, trnd03, csv) {
    var tmp;
    if (trnd46 && trnd03 && trnd46 != 'null' && trnd03 != 'null') {
        trnd46 = parseInt(trnd46);
        trnd03 = parseInt(trnd03);
        if (trnd46 === trnd03) {
            if (csv)
                return "Stable";
            return '<span class="glyphicon glyphicon-arrow-right blue"></span>';
        }
        if (trnd46 > trnd03) {


            tmp = trnd03 + ((3 / 100) * trnd03);
            if (tmp > trnd46) {
                if (csv)
                    return "Stable";
                return '<span class="glyphicon glyphicon-arrow-right blue"></span>'
            } else {
                if (csv)
                    return "Decreasing";
                return '<span class="glyphicon glyphicon-arrow-down red"></span>'
            }
        } else if (trnd46 < trnd03) {
            tmp = trnd46 + ((3 / 100) * trnd46);
            if (tmp > trnd03) {
                if (csv)
                    return "Stable";
                return '<span class="glyphicon glyphicon-arrow-right blue"></span>'
            } else {
                if (csv)
                    return "Increasing";
                return '<span class="glyphicon glyphicon-arrow-up green"></span>'
            }
        }
    }
    return '';
}

