/**
 * 
 * @param {type} x
 * @returns {unresolved}
 * @author Vishnu K
 */
function numberWithComma(x) {
    var parts = x.toString().split(".");
    parts[0] = parts[0].replace(/\B(?=(\d{3})+(?!\d))/g, ",");
    return parts.join(".");
}


/**
 * 
 * @param {type} ev
 * @returns {Boolean}
 * @author Vishnu K
 */
function isNumberKeyOrCommaOrDotForCurrency(ev)
{
    var charCode = (ev.keyCode ? ev.keyCode : (ev.charCode ? ev.charCode : ev.which));
    if (charCode == 37 || charCode == 39 || charCode == 46) // allow left & right arrow, delete key
        return true;

    if (charCode != 8 && charCode > 31 && (charCode < 44 || charCode > 57 || charCode == 45 || charCode == 47))
        return false;
    return true;
}


/**
 * 
 * @param {type} retsId
 * @returns {undefined}
 * @author Vishnu K
 */
function showIestimate(retsId) {
    if (retsId) {
        var url = 'https://api.propmix.io/propmixapps/iEstimates?filter={"where":{"retsId":"' + retsId + '"}}';
        $.ajax({
            url: url,
            type: 'GET',
            success: function (data) {
                if (data[0]) {
                    var iEstimate = data[0]['iestimate'];
                    $("#ie_" + retsId).html(iEstimate);
                } else {
                    $("#ie_" + retsId).html('N/A');
                }
            },
            error: function (xhr, ajaxOptions, thrownError) {
                alert(thrownError);
            }
        });
    }

}


