function formatImageOrder(image) {
    if (image) {
        var imageInst = image.split('|'), array = [], img, template, imgName, len, sorted= [], str;
        len = imageInst.length;
        for (var i = 0; i < len; i++) {
            img = imageInst[i];
            template = img.substring(0, img.lastIndexOf("/") + 1);
            imgName = img.substring(img.lastIndexOf("/") + 1, img.length);
            imgName = imgName.split('.');
            array.push({'temp': template, 'value': parseInt(imgName[0]), 'ext': imgName[1]});
        }
        //console.log(JSON.stringify(array));
        array.sort(function (a, b) {
            if (a.value > b.value) {
                return 1;
            }
            if (a.value < b.value) {
                return -1;
            }
            // a must be equal to b
            return 0;
        });
        //console.log(JSON.stringify(array));
        for (var i = 0; i < len; i++) {
            img = array[i];
            str = img.temp+img.value.toString()+'.'+img.ext; 
            //console.log(str);
            sorted.push(str);
        }
        image  = sorted.join('|');
        
        
    }
    return image;
}


